/* Theme: cherryBlossom */
@theme reference {
  --color-cherryBlossom-background: 0 0% 100%;
  --color-cherryBlossom-foreground: 0 0% 3.9%;
  --color-cherryBlossom-card: 0 0% 100%;
  --color-cherryBlossom-card-foreground: 0 0% 3.9%;
  --color-cherryBlossom-popover: 0 0% 100%;
  --color-cherryBlossom-popover-foreground: 0 0% 3.9%;
  --color-cherryBlossom-primary: 329 86% 70%;
  --color-cherryBlossom-primary-foreground: 0 0% 98%;
  --color-cherryBlossom-secondary: 327 73% 97%;
  --color-cherryBlossom-secondary-foreground: 0 0% 9%;
  --color-cherryBlossom-muted: 210 40% 96%;
  --color-cherryBlossom-muted-foreground: 0 0% 45.1%;
  --color-cherryBlossom-accent: 326 78% 95%;
  --color-cherryBlossom-accent-foreground: 0 0% 9%;
  --color-cherryBlossom-destructive: 0 72% 51%;
  --color-cherryBlossom-destructive-foreground: 0 0% 100%;
  --color-cherryBlossom-border: 214 32% 91%;
  --color-cherryBlossom-input: 214 32% 91%;
  --color-cherryBlossom-ring: 329 86% 70%;
}

.theme-cherryBlossom {
  --color-background: var(--color-cherryBlossom-background);
  --color-foreground: var(--color-cherryBlossom-foreground);
  --color-card: var(--color-cherryBlossom-card);
  --color-card-foreground: var(--color-cherryBlossom-card-foreground);
  --color-popover: var(--color-cherryBlossom-popover);
  --color-popover-foreground: var(--color-cherryBlossom-popover-foreground);
  --color-primary: var(--color-cherryBlossom-primary);
  --color-primary-foreground: var(--color-cherryBlossom-primary-foreground);
  --color-secondary: var(--color-cherryBlossom-secondary);
  --color-secondary-foreground: var(--color-cherryBlossom-secondary-foreground);
  --color-muted: var(--color-cherryBlossom-muted);
  --color-muted-foreground: var(--color-cherryBlossom-muted-foreground);
  --color-accent: var(--color-cherryBlossom-accent);
  --color-accent-foreground: var(--color-cherryBlossom-accent-foreground);
  --color-destructive: var(--color-cherryBlossom-destructive);
  --color-destructive-foreground: var(--color-cherryBlossom-destructive-foreground);
  --color-border: var(--color-cherryBlossom-border);
  --color-input: var(--color-cherryBlossom-input);
  --color-ring: var(--color-cherryBlossom-ring);
}

@media (prefers-color-scheme: dark) {
  .theme-cherryBlossom {
    --color-background: 240 10% 3.9%;
    --color-foreground: 0 0% 98%;
    --color-card: 240 10% 3.9%;
    --color-card-foreground: 0 0% 98%;
    --color-popover: 240 10% 3.9%;
    --color-popover-foreground: 0 0% 98%;
    --color-primary: 329 86% 90%;
    --color-primary-foreground: 240 5.9% 10%;
    --color-secondary: 240 3.7% 15.9%;
    --color-secondary-foreground: 0 0% 98%;
    --color-muted: 240 3.7% 15.9%;
    --color-muted-foreground: 240 5% 64.9%;
    --color-accent: 326 78% 35%;
    --color-accent-foreground: 0 0% 98%;
    --color-destructive: 0 62.8% 30.6%;
    --color-destructive-foreground: 0 0% 98%;
    --color-border: 240 3.7% 15.9%;
    --color-input: 240 3.7% 15.9%;
    --color-ring: 329 86% 90%;
  }
}

